// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;
 
contract Simplebank {
  uint public numberOfFunders;
  mapping(address => bool) private funders;
  mapping(uint => address) private lutFunders;
  address public owner;
  mapping(address => uint) private fundersCumSum;

  constructor (){
    owner = msg.sender;
  }

  modifier onlyOwner(){
    require(msg.sender == owner, "Only the owner can do that");
    _;
  }

  function transferOwnership(address newOwner) external onlyOwner{
    owner = newOwner;
  }

  function addFunds() external payable{
    address funder = msg.sender;
    if(!funders[funder]){
      uint index = numberOfFunders++;
      funders[funder]=true;
      lutFunders[index] = funder;
      fundersCumSum[funder] = msg.value;
    }
    else{
      fundersCumSum[funder] += fundersCumSum[funder] + msg.value;
    }
  }
  
  function getAllFunders() external view returns(address[] memory) {
    address[] memory _funders = new address[](numberOfFunders);
    for(uint i=0; i<numberOfFunders ; i++){
      _funders[i]=lutFunders[i];
    }
    return _funders;
  }

  function withdraw(uint withdrawAmount) external {
    require(withdrawAmount <= 1000000000000000000 || msg.sender==owner, "You can't withdraw more than 1 ether");
    payable (msg.sender).transfer(withdrawAmount);
  }
}

